import { makeStyles } from "@mui/styles";


export const useStyles = makeStyles({
  container:{
    display:"flex"
  },
  text:{
    '& p':{
      letterSpasing:1.8,
      fontSize:55,
      width:689,
      margin:'0 110px'
    }
  },
  secondColumn:{
    paddingRight:112,
    width:'50%',
    '& img':{
      float:'right'
    }
  }
})
